// SPDX-License-Identifier: MIT
pragma solidity ^0.7.4;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@chainlink/contracts/src/v0.7/VRFConsumerBase.sol";
import "@chainlink/contracts/src/v0.7/KeeperCompatible.sol";
import "../library/Governance.sol";
import "../interface/INftAsset.sol";
import "./LootBox.sol";

contract LootBoxFactory is
    Governance,
    VRFConsumerBase,
    IERC721Receiver,
    KeeperCompatible
{
    using Address for address;
    using SafeMath for uint256;

    event LootBoxAdded(uint256 indexed id, address author);

    uint256 public _maxCount = 10000;
    address public _nftContract = address(0x0000000000000000000000);
    address public _feeAccount = address(0x0000000000000000000000);
    uint256 public _feeAmount = 0;
    uint256 public _nftMaxCountPerUser = 3;
    uint256 _linkFee = 0;
    bytes32 _linkKeyHash = bytes32("");

    mapping(address => uint256) public _lastMintedNFTId;
    mapping(bytes32 => address) public requestIdToMinter;
    uint256 public nlimit = 10;
    uint256 public immutable interval = 300; // 5min

    uint256 public count = 0;

    ERC20 _cifiTokenContract = ERC20(0x0);

    address[] public queue_list;
    uint256[] public queue_timestamp_list;
    mapping(address => uint256) public queue_count_by_address;

    constructor(
        address cifi,
        address nftContract,
        address feeAccount,
        address vrfCoordinator,
        address linkToken,
        bytes32 linkKeyHash,
        uint256 linkFee
    ) VRFConsumerBase(vrfCoordinator, linkToken) {
        _cifiTokenContract = ERC20(cifi);
        _nftContract = nftContract;
        _feeAccount = feeAccount;
        _feeAmount = 1 * (10**18);
        _linkKeyHash = linkKeyHash;
        _linkFee = linkFee;
    }

    function checkUpkeep(bytes calldata)
        external
        override
        returns (bool upkeepNeeded, bytes memory)
    {
        bool _upkeepNeeded = false;
        if (queue_list.length >= nlimit) _upkeepNeeded = true;
        if (queue_list.length > 0) {
            if (block.timestamp - queue_timestamp_list[0] > interval) {
                _upkeepNeeded = true;
            }
        }
        upkeepNeeded = _upkeepNeeded;
    }

    function performUpkeep(bytes calldata) external override {
        count = count + 1;
        internal_mint(queue_list[0]);
    }

    function setCifiContract(address cifi) public onlyGovernance {
        _cifiTokenContract = ERC20(cifi);
    }

    function ChangeFeeAccount(address newFeeAccount)
        public
        onlyGovernance
        returns (bool)
    {
        _feeAccount = newFeeAccount;
        return true;
    }

    function ChangeFeeAmount(uint256 newFeeAmount)
        public
        onlyGovernance
        returns (bool)
    {
        _feeAmount = newFeeAmount;
        return true;
    }

    function ableClaim() public view returns (bool) {
        if (LootBox(_nftContract).balanceOf(msg.sender) < _nftMaxCountPerUser) {
            return true;
        } else {
            return false;
        }
    }

    function pushQueueList(address addr) internal {
        queue_list.push(addr);
        queue_timestamp_list.push(block.timestamp);
    }

    function popQueueList() internal {
        uint256 length = queue_list.length;
        if (length == 0) return;
        address addr = queue_list[0];
        uint256 queue_count = queue_count_by_address[addr];
        queue_count_by_address[addr] = queue_count - 1;
        for (uint256 i = 0; i < length - 1; i++) {
            queue_list[i] = queue_list[i + 1];
            queue_timestamp_list[i] = queue_timestamp_list[i + 1];
        }
        queue_list.pop();
        queue_timestamp_list.pop();
    }

    function mint() public returns (uint256) {
        require(
            LINK.balanceOf(address(this)) >= _linkFee,
            "LootBoxFactory: Not enough LINK - fill contract with faucet"
        );
        require(
            LootBox(_nftContract).totalSupply() < _maxCount,
            "LootBoxFactory: Total tokens were already minted!"
        );
        uint256 queue_count = queue_count_by_address[msg.sender];
        uint256 balance = LootBox(_nftContract).balanceOf(msg.sender);
        require(
            (balance + queue_count) < _nftMaxCountPerUser,
            "LootBoxFactory: already claim 5 times"
        );

        _cifiTokenContract.transferFrom(msg.sender, _feeAccount, _feeAmount);
        pushQueueList(msg.sender);
        queue_count_by_address[msg.sender] = queue_count + 1;
        return balance + queue_count + 1;
    }

    function internal_mint(address addr) internal returns (bytes32) {
        _lastMintedNFTId[addr] = 0;
        bytes32 requestId = requestRandomness(_linkKeyHash, _linkFee);
        requestIdToMinter[requestId] = addr;
        return requestId;
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness)
        internal
        override
    {
        require(
            LootBox(_nftContract).totalSupply() < _maxCount,
            "LootBoxFactory: Total tokens were already minted!"
        );
        address minter = requestIdToMinter[requestId];
        require(
            LootBox(_nftContract).balanceOf(minter) < _nftMaxCountPerUser,
            "LootBoxFactory: already claimed max count times!"
        );
        uint256 nftID = (randomness % _maxCount) + 1;

        while (LootBox(_nftContract).exists(nftID)) {
            nftID = ((nftID + 1) % _maxCount) + 1;
        }
        LootBox(_nftContract).mint(minter, nftID);
        _lastMintedNFTId[minter] = nftID;
        popQueueList();
        emit LootBoxAdded(nftID, minter);
    }

    function burn(uint256 tokenId) external returns (bool) {
        LootBox(_nftContract).safeTransferFrom(
            msg.sender,
            address(this),
            tokenId
        );
        LootBox(_nftContract).burn(tokenId);
        return true;
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}
